import React, { Component } from 'react';

class ContactLink extends Component {

  render() {
    let { image, alt, link } = this.props;

    return (
      <div class="contact">
        <a href={link}>
          <img class="contact__image" src={image} alt={alt}></img>
          <p class="contact__link">{link}</p>
        </a>
      </div>
    )
  }
}

export default ContactLink;
